import React, { Component } from 'react';

import Item from './item.js'


const tab=[
    {name:"ahmed",
     lastname:"ben ali"}
     ,
     {name:"ali",
     lastname:"ben ali"},

     {name:"rayen",
     lastname:"ben ali"}
]

class List extends Component {
   
    render() { 
        return ( <div className="list">
          { tab.map((el,index)=><Item item={el} key={index} />)}
        </div>);
    }
}
 
export default List;
